import { useHistory } from "react-router-dom/cjs/react-router-dom.min";

function Home () {

    const history = useHistory();

    return (
        <div>
            <h1> Home </h1>
            <button onClick={history.push('/find')}>Find</button>
            <button onClick={history.push('/soup')}>Soup</button>
            <button onClick={history.push('/domParser')}>DomParser</button>
        </div>
    )
}

export default Home;
